def get_display_range():

    sliderend = slider.end
    sliderend= pd.to_datetime(int(sliderend), unit="ms")

    sliderstart = slider.start
    sliderstart = pd.to_datetime(int(sliderstart), unit="ms")

    end = sliderend
    start = sliderstart

    sv = slider.value

    sv_0 = pd.to_datetime(int(sv[0]), unit="ms")
    sv_1 = pd.to_datetime(int(sv[1]), unit="ms")

    value = (sv_0, sv_1)

    return start, end, value


def fetch_data(name):

    if name == "data1":
        name = data1
    elif name == "data2":
        name = data2

    dataframe = pd.DataFrame(name)

    dataframe.drop(["e","E", "t","s","b","a","M"], axis=1, inplace=True)
    dataframe["time"]= pd.to_datetime(dataframe["T"], errors="coerce", unit='ms')
    dataframe["q"] = dataframe["q"].astype("float32").round(4)
    dataframe["p"] = dataframe["p"].astype("float32").round(2)
   

    return dataframe


