def make_plot(src1,src2,src3):

    # Genel Grafik
    p = figure(width=900,height=500,x_axis_type ="datetime",y_axis_location="right" ,toolbar_location="right")
    p.background_fill_color = "black"
    p.xgrid.grid_line_color = None
    p.ygrid.grid_line_color = None
    p.xaxis[0].formatter = DatetimeTickFormatter(days="%m/%d", hours="%H", minutes="%H:%M")
    p.yaxis[0].formatter = NumeralTickFormatter(format="$:.2f")

    #p.border_fill_color = "#585858"

    p.xaxis.visible=False


    colorgrey =("#303030","#505050","#707070","#909090","#A9A9A9")
    greymap = LinearColorMapper(palette=colorgrey, low=src1.data["scaled"].min(), high=src1.data["scaled"].max())
    #Genel Green
    gnkutugreen= p.rect(x="genelRectOrtanokta", y="p", width=timedelta(minutes=4), height=0.07, source=src1 ,color=None,fill_alpha=0.4 ,line_color="rectgenelgreen", line_width=1)
    #Genel Red
    genelkutured= p.rect(x="genelRectOrtanokta", y="p", width=timedelta(minutes=4), height=0.07, source=src1 ,color=None ,line_color="rectgenelred", line_width=1)
    # Genel gri (volume)
    genelgri= p.hbar(y="p", right="scaledtime",left="hbarsol", height=0.1 ,line_color={"field":"scaled", "transform": greymap} ,line_alpha=0.9 ,fill_color={"field":"scaled", "transform": greymap}, fill_alpha=0.4,source=src1)
    # Genel renkli delta( Volume)
    gnsl = p.hbar(y="p", right="gnlhbarscaledtime", left="hbarsol", height=0.1, line_color="gnlhbarredcolor",fill_alpha=0.3,fill_color="gnlhbarredcolor" ,source= src1)
    gnby = p.hbar(y="p", right="gnlhbarscaledtime", left="hbarsol", height=0.1, line_color="gnlhbargreencolor",fill_alpha=0.3,fill_color="gnlhbargreencolor" ,source=src1)


    # Sol grafik 
    p2 = figure(width=200, height =500, y_axis_location="left", toolbar_location="left",name="p2")
    p2.background_fill_color = "black"
    p2.xgrid.grid_line_color = None
    p2.ygrid.grid_line_color = None

    p2.xaxis.visible=False
    p2.yaxis.visible=False
    #p2.border_fill_color = "#585858"

    p2.y_range= p.y_range
    #p2.yaxis[0].formatter = NumeralTickFormatter(format="$:.2f")

    #Toplam hacmli green/red hbar 
    solred = p2.hbar(y="p", right="top", left=0, height=0.1, line_color="hbarredcolor",fill_alpha=0.3,fill_color="hbarredcolor" ,source= src2)
    solgreen = p2.hbar(y="p", right="top", left=0, height=0.1, line_color="hbargreencolor",fill_alpha=0.3,fill_color="hbargreencolor" ,source= src2)

    #Sol blue(toplam) Green and Red
    colorblue=("#000099","#0000FF","#0066FF","#0099FF","#00CCFF","#00FFFF")
    bluemap = LinearColorMapper(palette=colorblue, low=src2.data["top"].min(), high=src2.data["top"].max())

    colorred = ("#400000","#730000","#a60000","#d90000","#ff0000")
    redmap = LinearColorMapper(palette=colorred, low=src2.data["sel"].min(), high=src2.data["sel"].max())

    colorgreen = ("#1a2e00","#003d00","#009900","#00cc00","#00ff00")
    greenmap = LinearColorMapper(palette=colorgreen, low=src2.data["buy"].min(), high=src2.data["buy"].max())


    #SadeceSat
    p2.hbar(y="p", right="sel", left=0, height=0.1, line_color={"field":"sel", "transform": redmap},line_width=0.7,fill_alpha=0.4,fill_color={"field":"sel", "transform": redmap} ,source= src2)
    #Sadece al
    p2.hbar(y="p", right="buy", left=0, height=0.1, line_color={"field":"buy", "transform": greenmap},line_width=1,fill_alpha=0.3,fill_color={"field":"buy", "transform": greenmap} ,source= src2)
    #Sadece als+ sats toplam hacim
    p2.hbar(y="p", right="top", left=0, height=0.1, line_color={"field":"top", "transform": bluemap},fill_alpha=0.4,fill_color={"field":"top", "transform": bluemap} ,source= src2)


    p3 = figure(width=900, height=75, x_axis_type = "datetime", x_range = p.x_range,y_axis_location="right" ,toolbar_location="right", y_range=["Volume","Delta"])
    p3.background_fill_color = "black"
    p3.xgrid.grid_line_color = None
    p3.ygrid.grid_line_color = None
    p3.xaxis[0].formatter = DatetimeTickFormatter(days="%m/%d", hours="%H", minutes="%H:%M")

    colorblue = ("#b3b3ff","#6666ff","#1a1aff","#0000cc","#000066")
    bluemap = LinearColorMapper(palette=colorblue, low=src3.data["toplam"].min(), high=src3.data["toplam"].max())

    vol = p3.rect(x="newtime", y="vlm", width=timedelta(minutes=5), height=1, source=src3 ,color={"field":"toplam", "transform": bluemap} ,line_color="white", line_width=0.3)
    deltamgreen = p3.rect(x="newtime", y="dlt", width=timedelta(minutes=5), height=1,fill_color="dltgreencolor" ,source=src3 ,line_color="white", line_width=0.3)
    deltamred = p3.rect(x="newtime", y="dlt", width=timedelta(minutes=5), height=1,fill_color="dltredcolor" ,source=src3 ,line_color="white", line_width=0.3)


    labeldlt = LabelSet(x="newtime", y="dlt",text="strdelta",text_align="center" ,source=src3, render_mode="canvas", text_color="white",text_font_size="0.5rem")

    labelvol = LabelSet(x="newtime", y="vlm",text="strtoplam",text_align="center" ,source=src3, render_mode="canvas", text_color="white",text_font_size="0.5rem")

    p3.add_layout(labelvol)
    p3.add_layout(labeldlt)

    return p,p2,p3

